@greenpeacefr Une écologie en faveur des plus précaires, c’est une politique en faveur du nucléaire. 

Une électricité peu chère, décarbonée et qui garantit notre indépendance vis-à-vis des autres puissances. 

Pour le reste des propositions : https://www.fabienroussel2022.fr/le_programme

@greenpeacefr L’alimentation est au cœur de mon projet : j’ai d’ailleurs été critiqué pour cela !

Je créerai un fonds de 10 milliards pour garantir à chaque enfant une alimentation de qualité, en circuit court dans les cantines. 

Nous créerons une révolution de la fourche à la fourchette.

@greenpeacefr Vous avez raison, les riches polluent plus, ils doivent contribuer plus à la lutte contre le réchauffement climatique : ils paieront plus. 

Nous rétablirons l’ISF et le triplerons. 

Pas de greenwashing, mais un ISF social et écolo.

