@FranceInsoumise @JLMelenchon il faut les soutenir.

@Fabien_Roussel C'est vraiment dommage, Roussel.

Il y a des gens qui les ont vraiment lu les déclarations de patrimoine et de revenus, et question revenus, à ta place je la ramènerai pas trop.

Et du coup t'as fait quoi en étant payé 381.000€ ? 🙄 https://twitter.com/Weatherboy_fr/status/1502995423568482315/photo/1

@Fabien_Roussel Continue de taper sur qui l'on sait Camarade ! Tu préfères Macron #5ansdeplus ??

Ma seule motivation en tant qu'électeur (et en tant que #prof), le programme. En lisant #laec2022, j'y adhère totalement.

Donc je vote #MelenchonPresident2022 le 10 et le 24.04.22.

@laffairedusiecl Je souhaite que tout le monde ait accès à une alimentation saine et de qualité. 

Manger de la viande, en manger moins, mais de la bonne. 

10 milliards seront investis pour défendre nos paysans et une alimentation de meilleure qualité.

@laffairedusiecl Je ne propose pas, comme d’autres, d’arrêter toutes constructions. 

Nous construirons plus proprement, avec des matériaux bio et géo-sourcés. 

Ces matériaux bénéficieront d’une TVA réduite à 5,5%.

@laffairedusiecl Sauver le climat, c’est aussi mieux isoler nos logements. 

Si nous gardons le rythme actuel de rénovation énergétique, nous serons neutres en carbone en 2300.

Nous multiplierons par 10 les investissements dans ce domaine.

@laffairedusiecl Un autre scandale : celui de la réduction du maillage des lignes de train.

Nous investirons 5 milliards par an dans le train pour reconstruire des milliers de kilomètres de petites lignes, accélérer le déploiement du TGV.

La part de fret ferroviaire sera doublée.

@laffairedusiecl Une France décarbonée est aussi une France des transports propres.

Nous financerons la gratuité des transports publics, des TER gratuits pour le domicile/travail, 30% de baisse des prix du train.

Les Français doivent se déplacer proprement, ne pas être assignés à résidence.

@laffairedusiecl Contrairement à tous les autres candidats de gauche, je souhaite investir dans le nucléaire.

Les enjeux sont multiples : avoir une énergie décarbonée, peu chère, indépendante de la météo, et des autres puissances mondiales.

La seule manière de sortir du gaz et du pétrole.

@laffairedusiecl La priorité : sortir des énergies fossiles pour décarboner notre économie.

Nous devons donc investir massivement dans la production d’énergie décarbonée, et dans les économies d’énergie. 

Il faut suivre les recommandations du GIEC : investir 6% du PIB de la France par an.

Un #soutien qui n'est pas forcément un ralliement. 
Mais il est vrai que la candidature de @Fabien_Roussel ne manque pas de panache.
@AvecRoussel, on peut vraiment espérer une France des #JoursHeureux. https://twitter.com/Radicaux_Gauche/status/1502612660373934080/photo/1

Non seulement, je vais voter  @Fabien_Roussel le 10 avril , mais des deux mains !

#Roussel
